import { Button as NativeBaseButton, IButtonProps, Heading } from 'native-base';

type Props = IButtonProps & {
  tittle: string,
}

export function Button({ tittle, ...rest }: Props ) {
  return (
    <NativeBaseButton
    {...rest}
    bg='green.500'
    h={14}
    w='100%'
    mt={8}
    >
        <Heading
        color='white'
        >
            {tittle}
        </Heading>
    </NativeBaseButton>
  );
}
